    [],nt"num_tags": 8,nt"name": "fish-macroinvertebrate-and-habitat-survey-of-three-willapa-national-wildlife-refuge-stream",nt"isopen":
    false,nt"url": null,nt"notes": "In September and October 2003, staff from
    the Columbia River Fisheries Program Office (CRFPO) conducted fish, macroinvertebrate,
    and habitat surveys of three small, unnamed creeks that flow across Willapa National
    Wildlife Refuge (WNWR). The goal of this project was to provide the refuge with
    initial baseline studies of the three unnamed streams for population attributes
    of salmonids and other fish species, the macroinvertebrate community, and habitat
    quality and quantity. These surveys were not comprehensive watershed analyses. They
    were intended to be initial baseline surveys that would assist WNWR staff in future
    management actions.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
